  true,\n\t\"url\": null,\n\t\"notes\": \"Conceptual model for the Newberry Caldera
  geothermal area. Model is centered around caldera and evaluates geologic information
  in tandem with some geophysical datasets to derive a conceptual subsurface model.
  nnIncludes:nn--Geologic information from the USGS geologic map of Newberry and cross-sections
  from Sonnenthal et al, 2012n--West flank seismic body representing a fractional
  change in seismic velocity of 0.1, defined in Beachly et al., 2012 and Heath et
  al., 2015 n--West flank gravity body \"granite\" that represents a gravity anomaly
  identified in Waibel et al., 2014 (DOE document, figure 35)n--Magma chamber defined
  seismically, found in Heath et al., 2015 n--Ring fracture fault intrusionsn--Various
  faults sourced from the USGS geologic map of Newberry, Grasso et al. 2012's fault
  and fissure mapping\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
